  false,\n\t\"url\": null,\n\t\"notes\": \"American woodcock related research at Moosehorn
  National Wildlife Refuge from March 29 to August 31, 1979. The woodcock project
  at the Moosehorn National Willdlife Refuge experiments with different management
  techniques to increase woodcock populations, which can then be implemented by private
  small woodlot owners as well as large scale forest management. Related research
  has been going on at the refuge for sixteen years; this report, compiled by the
  student banding crew, describes and discusses the 1979 field season.\",\n\t\"license_title\":
